import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Number from "./Number.js";
import createArray from "./utils.js";

const App = () => {
  //let numberArr = [9, 8, 7, 6, 5, 4, 3, 2, 1, 0];
  //let numberArr = createArray;
  let numberArr;
  let i;
  for (i = 9; i <= 0; i--) {
    numberArr.push(i);
  }
  return (
    <>
      {numberArr.value.map(number => (
        <Number key={number} number={number} />
      ))}
    </>
  );
};

export default App;
